// Zero median RSI calculation (RSI - 50)
function rsiZeroCalc(dataArray, arrLen) {
    let returnedRSI = 0
    var lastUp = new Array(arrLen).fill(0)  // create blank array
    var lastDn = new Array(arrLen).fill(0)

    for (let i = 1; i < arrLen; i++) {
        if (dataArray[i] > dataArray[i - 1]) {
            lastUp[i - 1] = dataArray[i] - dataArray[i - 1]  // Add win to last 14 array.
        } else { lastUp[i - 1] = 0 }

        if (dataArray[i] < dataArray[i - 1]) {
            lastDn[i - 1] = dataArray[i - 1] - dataArray[i]  // Add win to last 14 array.
        } else { lastDn[i - 1] = 0 }
    }

    // Calculate Up and Down averages
    let sumU = 0 // Initialize sumU variable. 
    for (let j = 0; j < arrLen; j++) {
        sumU = sumU + lastUp[j]
    }
    let averageU = sumU / arrLen

    let sumD = 0 // Initialize sumD variable. 
    for (let i = 0; i < arrLen; i++) {
        sumD = sumD + lastDn[i]
    }
    let averageD = sumD / arrLen

    // Calculate relative strength
    let relativeStrength = 0
    if (averageD > 0) {
        relativeStrength = averageU / averageD
    } else {
        relativeStrength = 0
    }

    /* Calculate RSI */
    let relativeStrengthIndex = 100 - 100 / (1 + relativeStrength)

    if (relativeStrengthIndex !== undefined) {
        returnedRSI = relativeStrengthIndex.toFixed(2)
    } else {
        returnedRSI = 0
    }
    return returnedRSI - 50     //subtract 50 from RSI result to shift the median to zero instead of 50
}


