function rsiTV(dataArray, length) {
    let upVal = Math.max(dataArray.at(-1) - dataArray.at(-2), 0) // upward change
    let downVal = Math.max(dataArray.at(-2) - dataArray.at(-1), 0) // downward change

    let upRma = rma(upVal, variable.upRmaPrev, length)
    let dnRma = rma(downVal, variable.dnRmaPrev, length)
    variable.upRmaPrev = upRma
    variable.dnRmaPrev = dnRma

    let rs = upRma / dnRma
    let res = 100 - 100 / (1 + rs)
    return res
}

/*
pine_rma(src, length) =>
    alpha = length
    sum = 0.0
    sum := na(sum[1]) ? sma(src, length) : (src + (alpha - 1) * nz(sum[1])) / alpha
*/
function rma(price, prevRMA, length) {
    let k = 1 / length
    let rmaCalc = price * k + prevRMA * (1 - k)
    return rmaCalc
}


// //////////////////////////
function newRSI(dataArray) {
    let sumGain = 0
    let sumLoss = 0
    for (let i = 1; i < dataArray.length; i++) {
        let difference = dataArray[i] - dataArray[i - 1];
        if (difference >= 0) {
            sumGain += difference
        } else {
            sumLoss -= difference
        }
    }

    if (sumGain == 0) { return 0 }
    //if (Math.abs(sumLoss) < Tolerance) return 100;

    let relativeStrength = sumGain / sumLoss

    return 100.0 - (100.0 / (1 + relativeStrength))
}

// *************************
function calculateEMA(price, previousEMA, periods) {
    let k = 2 / (1 + periods)
    if (isNaN(previousEMA)) {
        return price
    }
    let emaCalc = price * k + previousEMA * (1 - k)
    return emaCalc
}

// ///////////////////////////////////////////////////////////////////
function WiMA(src, prevVal, length) {
    if (isNaN(prevVal)) {
        // ensure the result is always valid
        prevVal = 0
    }
    let MA_s = (src + prevVal * (length - 1)) / length
    return MA_s
}

