function cross(value1, value1prev, value2, value2prev) {
    // a replication of TradingView's cross() function

    let result = 0
    //check 1prev under 2prev and value1 over value2
    // OR 2prev under 1prev and 2prev over 1prev
    if (value1prev < value2prev && value1 > value2) {
        result = 1
    }
    if (value2prev < value1prev && value2 > value1) {
        result = 1
    }
    return result
}

