function HeikinCalc(iOpen, iHigh, iLow, iClose, openPrev, closePrev) {
    let output = 0
    // replace any NaN with zeros if needed
    //variable.heikinOpenPrev = variable.heikinOpenPrev ? variable.heikinOpenPrev : 0
    closePrev = !isNaN(closePrev) ? closePrev : 0

    let oClose = (iOpen + iHigh + iLow + iClose) / 4
    let oOpen = NaN

    if (isNaN(openPrev)) {
        oOpen = (iOpen + iClose) / 2
    } else {
        oOpen = (openPrev + closePrev) / 2
    }

    let oHigh = Math.max(iHigh, Math.max(oOpen, oClose))
    let oLow = Math.min(iLow, Math.min(oOpen, oClose))

    this.open = oOpen
    this.close = oClose
    this.high = oHigh
    this.low = oLow

    //return output
}


function calculateStandardDeviation(array) {
    const n = array.length
    const mean = array.reduce((a, b) => a + b) / n
    const StandDev = Math.sqrt(array.map(x => Math.pow(x - mean, 2)).reduce((a, b) => a + b) / n)
    return StandDev
}


function calculateEMA(price, previousEMA, periods) {
    let k = 2 / (1 + periods)
    let emaCalc = price * k + previousEMA * (1 - k)
    return emaCalc
}

